    # Main idea is to check if the url and the current path is a match
    if reverse(url) == request.path:
        return "active-link"
    # print("url: ", url)
    # print("request.path: ", request.path)
    if request.path in reverse(url) and len(request.path) > 1:
        return "active-link"
    return ""

